   "source": [
    "# About the company:\n",
    "\n",
    "My Green Initiative Inc. was started in 2015 as a provider of water saving devices and small energy storage devices and systems. The company has seen a massive amount of growth within the past 7 years and would like to expand their product offering and scale the business to accomodate and access the green energy, renewable energy race. Soalr power is at the forefront of renewable energy and therefore the company, with its history will be able to access the technology from its suplliers. The CEO Mr Tom Wright has contacted us about doing a project to analyse data acquired from a national repository on the viability of carrying out such a venture and to give insight to where the best options are to market and start the business up. The funding is all at hand, but the board wants to direct with their aim to the consumer for their products. "
   ]
  },
