    "\n",
    "● My Green Initiative: A company which provides water and small energy storage solutions to the public. \n",
    "\n",
    "● Tom Wright: A director and CEO of My Green Initiative . \n",
    "\n",
    "● The board of My Green Initiative.  \n",
    "\n",
    "● The marketing team of My Green Initiative."
