    "# Ask:\n",
    "\n",
    "## Guiding Questions:\n",
    "\n",
    "● What is the problem you are trying to solve?\n",
    "\n",
    "      The problem we are trying to solve for The Green Initiative is to open an avenue for new business opportunities in the renewable energy market.\n",
    "\n",
    "● How can your insights drive business decisions? \n",
    "    \n",
    "       The insights gained from this analysis will allow the board and the CEO to understand the market, gain an understanding to the requirement in \n",
    "       terms of sunlight and the most adapatble and viable market to start the business. \n",
    "\n",
    "## Tasks:\n",
    "\n",
    "1. Identify the business task ☑︎\n",
    "2. Consider key stakeholders  ☑︎\n",
    "\n",
    "## Deliverable:\n",
    "\n",
    "☑︎ A clear statement of the business task you have selected to investigate"
   ]
