    "# Prepare:\n",
    "\n",
    "## Guiding Questions:\n",
    "\n",
    "● Where is your data located?\n",
    "\n",
    "    The data is located on google drive and secured. \n",
    "\n",
    "● How is the data organized?\n",
    "\n",
    "    The data is organized by coulmn name in two data sets namely by postal_code\n",
    "    and census-tract. these two will be combined by region_name in order to\n",
    "    collate and bring the data together. \n",
    "\n",
    "● Are there issues with bias or credibility in this data? Does your data ROCCC?\n",
    "\n",
    "    As this is a public data set i see no bias or credibility with the data. The\n",
    "    data is for the US states. The data is for the business proposition at\n",
    "    hand, and is targeted at answering the questiopns posed to us by the business.\n",
    "    \n",
    "    Yes the data frame is reliable, original, comprehensive, current and is cited.\n",
    "\n",
    "● How are you addressing licensing, privacy, security, and accessibility?\n",
    "\n",
    "    This is a public database therefore it has no licensing. The database has\n",
    "    been downloaded and is kept on goolgle drive for security. \n",
    "\n",
    "● How did you verify the data’s integrity?\n",
    "\n",
    "    Project Sunroof computes how much sunlight hits your roof in a year. Solar\n",
    "    viability is determined using a methodology found here: \n",
    "    https://www.google.com/get/sunroof/data-explorer/data-explorer-methodology.pdf \n",
    "    The use of this data is subject to Google's Terms of Service. Feel \n",
    "    free to include this data from Project Sunroof in other analyses, materials,\n",
    "    reports, and communications with the following attribution: Source: \n",
    "    Google Project Sunroof data explorer (August 2017).\n",
    "    \n",
    "    last updated: 20 Sept 2022, 09:58:22 UTC+2 \n",
    "\n",
    "● How does it help you answer your question?\n",
    "\n",
    "    The data set and analysis here after will answer the questions, the client has\n",
    "    asked. \n",
    "\n",
    "● Are there any problems with the data?\n",
    "\n",
    "    Having a brief look throughthe data in sheets there seems to be no problems\n",
    "    with the data, but there will be a deeper dive as the analysis carries \n",
    "    on.\n",
    "\n",
    "## Tasks:\n",
    "\n",
    "1. Download data and store it appropriately. ☑︎\n",
    "2. Identify how it’s organized.              ☑︎\n",
    "3. Sort and filter the data.                 ☑︎\n",
    "4. Determine the credibility of the data.    ☑︎\n",
    "\n",
    "## Delverable:\n",
    "\n",
    "   ☑︎  A description of all data sources used"
