    "# Act:\n",
    "\n",
    "## Guiding Questions:\n",
    "\n",
    "● What is your final conclusion and insights based on your analysis?\n",
    "\n",
    "- Based on existing installs and potential buildings which could be leveraged for installs, there are a number of buildings which still have potential for installs.\n",
    "\n",
    "- Kwh per year for the north/south/east and west is more than adequate for installations in any direction givent the total median sunlight requirement for minimum solar potential.\n",
    "\n",
    "- Many of the states wihin the analysis have not had any or very few installations done, and have the potential for installs as the requirement for roof space and sunlight meet the requirements\n",
    "\n",
    "- There are three states which have been identified through the analysis which\n",
    "meet the criteria for potential available installations, which all have enough available building roof space, enough Kwh potential per year, and generation capacity for roof space utilised with the installs.\n",
    "\n",
    "        1) Pennsylvania\n",
    "        2) New York\n",
    "        3) Michigan\n",
    "    \n",
    "\n",
    "● How could your team and business apply your insights?\n",
    "\n",
    "The insights can be directly used in order to make decisions on where to focus thier marketing strategy, with th knowledge that their is enough potential business with the correct conditions for sales of solar installations. The CEO and board would be able to make a decision given the insights of the top three states which alll have very good potential to gain new business and introduce new solar installations.\n",
    "\n",
    "● What next steps would you or your stakeholders take based on your findings?\n",
    "\n",
    "The next steps would be to do a pilot study on the consumer and if the market is requiring solar installations. Then it would be price point and the amount people are willing to spend. Thirdly it would be which state then to introduce and do an aggressive marketing plan in to start up the business.\n",
    "\n",
    "● Is there additional data you could use to expand on your findings?\n",
    "\n",
    "There is a lot more indepth analysis which could be done in order to become far more specific in terms of geographic area within the state, as well as Kwh production and usage. \n",
    "\n",
    "At this stage, the business question is to establish a way forward to ascertain whether it is viable to even get the business off the ground. \n",
    "\n",
